import { createStore } from 'vuex';
import axios from 'axios';
const url = "https://moonstruck-vinyls.onrender.com";

export default createStore({
  state: {
    users: null,
    user: null,
    userAuth: null,
    userLoggedIn: null,
    token: null,
    products: null,
    product: null,
    selectedProduct: null,
    orders: null,
    cart: null,
    spinner: null,
    message: null,
    asc: true
  },

  mutations: {
    setUsers(state, users) {
      state.users = users;
    },

    setUser(state, user) {
      state.user = user;
    },

    set
  },

  actions: {
  }
});
